import React from 'react';

const RegisterForm = () => {
  const registerStyle = {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    minHeight: '100vh',
    backgroundColor: '#f2f2f2',
  };

  const cardStyle = {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    backgroundColor: '#fff',
    padding: '50px',
    borderRadius: '5px',
    boxShadow: '0 2px 4px rgba(0, 0, 0, 0.2)',
    marginBottom: '20px',
    width: '100%',
    maxWidth: '500px',
    textAlign: 'center',
  };

  const h1Style = {
    fontSize: '3rem',
    color: '#000',
    marginBottom: '30px',
  };

  const btnStyle = {
    backgroundColor: '#1abc9c',
    border: 'none',
    color: '#fff',
    padding: '10px 20px',
    borderRadius: '5px',
    fontSize: '16px',
    cursor: 'pointer',
    transition: 'all 0.3s ease',
  };

  const inputStyle = {
    padding: '10px',
    marginBottom: '20px',
    border: '1px solid #ccc',
    borderRadius: '5px',
    width: '100%',
    fontSize: '16px',
  };

  const joinUsStyle = {
    marginTop: '20px',
    textAlign: 'center',
    fontSize: '14px',
    color: '#999',
  };

  const linkStyle = {
    color: '#1abc9c',
    textDecoration: 'none',
  };

  const hoverStyle = {
    backgroundColor: '#148f77',
  };

  return (
    <div style={registerStyle} className="register">
      <div style={cardStyle} className="reg-card">
        <h1 style={h1Style}>Register</h1>
        <input style={inputStyle} type="text" placeholder="Username" />
        <input style={inputStyle} type="email" placeholder="Email" />
        <input style={inputStyle} type="password" placeholder="Password" />
        <button style={btnStyle} className="reg-btn">
          Register
        </button>
        <div style={joinUsStyle} className="join-us">
          Already have an account? <a style={linkStyle} href="#">Login</a>
        </div>
      </div>
    </div>
  );
};

export default RegisterForm;
